import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';

@Component({
  selector: 'app-controle-entradas',
  standalone: true,
  imports: [CommonModule],
  templateUrl: './controle-entradas.component.html',
  styleUrls: ['./controle-entradas.component.css']
})
export default class ControleEntradasComponent {

}
<div class="shadow-lg bg-white w-full h-full rounded-md py-4 px-6">
    <h5>Controlador de entrada e saída do veículo</h5>
</div>
